import{_ as t,a,b as r,c as o,d as i,e as n,f as l,g as s,h as c}from"./chunks/MC_PID_tuning-Airmode.DJ9U71dD.js";import{_ as h,c as d,a8 as m,o as p}from"./chunks/framework.BDnHobkS.js";const M=JSON.parse('{"title":"Посібник з налаштування PID для багатокоптерів (Ручне/Продвинуте)","description":"","frontmatter":{},"headers":[],"relativePath":"uk/config_mc/pid_tuning_guide_multicopter.md","filePath":"uk/config_mc/pid_tuning_guide_multicopter.md"}'),u={name:"uk/config_mc/pid_tuning_guide_multicopter.md"};function f(_,e,g,b,v,P){return p(),d("div",null,e[0]||(e[0]=[m('<h1 id="посібник-з-налаштування-pid-для-багатокоптерів-ручне-продвинуте" tabindex="-1">Посібник з налаштування PID для багатокоптерів (Ручне/Продвинуте) <a class="header-anchor" href="#посібник-з-налаштування-pid-для-багатокоптерів-ручне-продвинуте" aria-label="Permalink to &quot;Посібник з налаштування PID для багатокоптерів (Ручне/Продвинуте)&quot;">​</a></h1><p>Ця тема надає докладну інформацію про регулятори PX4 та їх налаштування.</p><div class="tip custom-block"><p class="custom-block-title">TIP</p><p><a href="./../config/autotune_mc.html">Autotune</a> is recommended for tuning the vehicles <em>around the hover thrust point</em>, as the approach described is intuitive, easy, and fast. Цього достатньо для багатьох транспортних засобів.</p></div><p>Використовуйте цю тему, коли налаштування навколо точки підняття на тягу не є достатнім (наприклад, на транспортних засобах, де є нелінійності та коливання при високій тяги). It is also useful for a deeper understanding of how the basic tuning works, and to understand how to use the <a href="#airmode-mixer-saturation">airmode</a> setting.</p><h2 id="настроика-крокування" tabindex="-1">Настройка крокування <a class="header-anchor" href="#настроика-крокування" aria-label="Permalink to &quot;Настройка крокування&quot;">​</a></h2><div class="info custom-block"><p class="custom-block-title">INFO</p><p>For safety reasons, the default gains are set to low values. Вам потрібно збільшити значення перед очікуванням гарної реакції управління.</p></div><p>Ось деякі загальні рекомендації для настройки:</p><ul><li>Усі коефіцієнти крокування потрібно збільшувати дуже повільно, оскільки великі коефіцієнти можуть призвести до небезпечних коливань! Зазвичай збільшуйте коефіцієнти на 20-30% за кожною ітерацією, зменшуючи до 5-10% для кінцевої точної настройки.</li><li>Перед зміною параметра приземліться. Повільно збільшуйте газ і перевіряйте наявність коливань.</li><li>Tune the vehicle around the hovering thrust point, and use the <a href="#thrust-curve">thrust curve parameter</a> to account for thrust non-linearities or high-thrust oscillations.</li><li>Optionally enable the high-rate logging profile with the <a href="./../advanced_config/parameter_reference.html#SDLOG_PROFILE">SDLOG_PROFILE</a> parameter so you can use the log to evaluate the rate and attitude tracking performance (the option can be disabled afterwards).</li></ul><div class="warning custom-block"><p class="custom-block-title">WARNING</p><p>Always disable <a href="./../advanced_config/parameter_reference.html#MC_AIRMODE">MC_AIRMODE</a> when tuning a vehicle.</p></div><h3 id="контролер-швидкості" tabindex="-1">Контролер швидкості <a class="header-anchor" href="#контролер-швидкості" aria-label="Permalink to &quot;Контролер швидкості&quot;">​</a></h3><p>The rate controller is the inner-most loop with three independent PID controllers to control the body rates (roll, pitch, yaw).</p><div class="info custom-block"><p class="custom-block-title">INFO</p><p>A well-tuned rate controller is very important as it affects <em>all</em> flight modes. A badly tuned rate controller will be visible in <a href="./../flight_modes_mc/position.html">Position mode</a>, for example, as &quot;twitches&quot; or oscillations (the vehicle will not hold perfectly still in the air).</p></div><h4 id="архітектура-форма-контролера-швидкості" tabindex="-1">Архітектура/Форма контролера швидкості <a class="header-anchor" href="#архітектура-форма-контролера-швидкості" aria-label="Permalink to &quot;Архітектура/Форма контролера швидкості&quot;">​</a></h4><p>PX4 supports two (mathematically equivalent) forms of the PID rate controller in a single &quot;mixed&quot; implementation: <a href="#parallel-form">Parallel</a> and <a href="#standard-form">Standard</a>.</p><p>Users can select the form that is used by setting the proportional gain for the other form to &quot;1&quot; (i.e. in the diagram below set <strong>K</strong> to 1 for the parallel form, or <strong>P</strong> to 1 for the standard form - this will replace either the K or P blocks with a line).</p><p><img src="'+t+'" alt="PIDMixed"></p><ul><li><em>G(s)</em> represents the angular rates dynamics of a vehicle</li><li><em>r</em> is the rate setpoint</li><li><em>y</em> is the body angular rate (measured by a gyro)</li><li><em>e</em> is the error between the rate setpoint and the measured rate</li><li><em>u</em> is the output of the PID controller</li></ul><p>Ці дві форми описані нижче.</p><div class="info custom-block"><p class="custom-block-title">INFO</p><p>The derivative term (<strong>D</strong>) is on the feedback path in order to avoid an effect known as the <a href="http://brettbeauregard.com/blog/2011/04/improving-the-beginner%E2%80%99s-pid-derivative-kick/" target="_blank" rel="noreferrer">derivative kick</a>.</p></div><div class="tip custom-block"><p class="custom-block-title">TIP</p><p>Для додаткової інформації дивіться:</p><ul><li><a href="https://www.controleng.com/articles/not-all-pid-controllers-are-the-same/" target="_blank" rel="noreferrer">Not all PID controllers are the same</a> (www.controleng.com)</li><li><a href="https://en.wikipedia.org/wiki/PID_controller#Standard_versus_parallel_(ideal)_form" target="_blank" rel="noreferrer">PID controller &gt; Standard versus parallel (ideal) PID form</a> (Wikipedia)</li></ul></div><h5 id="паралельнии-порт" tabindex="-1">Паралельний порт <a class="header-anchor" href="#паралельнии-порт" aria-label="Permalink to &quot;Паралельний порт&quot;">​</a></h5><p>The <em>parallel form</em> is the simplest form, and is (hence) commonly used in textbooks. У цьому випадку вихід контролера просто є сумою пропорційних, інтегральних та диференційних дій.</p><p><img src="'+a+'" alt="PIDParallel"></p><h5 id="стандартна-форма" tabindex="-1">Стандартна форма <a class="header-anchor" href="#стандартна-форма" aria-label="Permalink to &quot;Стандартна форма&quot;">​</a></h5><p>Ця форма математично еквівалентна паралельній формі, але основною перевагою є те, що (навіть якщо це здається протирічливим) вона роз&#39;єднує налаштування пропорційного коефіцієнта від інтегрального та диференціального коефіцієнтів. Це означає, що нову платформу легко можна налаштувати, взявши вигоди від дрона зі схожим розміром/інерцією і просто налаштувати коефіцієнт K, щоб він летів належним чином.</p><p><img src="'+r+'" alt="PIDStandard"></p><h4 id="оцінити-налаштування-pid" tabindex="-1">Оцінити Налаштування PID <a class="header-anchor" href="#оцінити-налаштування-pid" aria-label="Permalink to &quot;Оцінити Налаштування PID&quot;">​</a></h4><p>Пов&#39;язані параметри для налаштування регуляторів швидкості PID є наступні:</p><ul><li>Roll rate control (<a href="./../advanced_config/parameter_reference.html#MC_ROLLRATE_P">MC_ROLLRATE_P</a>, <a href="./../advanced_config/parameter_reference.html#MC_ROLLRATE_I">MC_ROLLRATE_I</a>, <a href="./../advanced_config/parameter_reference.html#MC_ROLLRATE_D">MC_ROLLRATE_D</a>, <a href="./../advanced_config/parameter_reference.html#MC_ROLLRATE_K">MC_ROLLRATE_K</a>)</li><li>Pitch rate control (<a href="./../advanced_config/parameter_reference.html#MC_PITCHRATE_P">MC_PITCHRATE_P</a>, <a href="./../advanced_config/parameter_reference.html#MC_PITCHRATE_I">MC_PITCHRATE_I</a>, <a href="./../advanced_config/parameter_reference.html#MC_PITCHRATE_D">MC_PITCHRATE_D</a>, <a href="./../advanced_config/parameter_reference.html#MC_PITCHRATE_K">MC_PITCHRATE_K</a>)</li><li>Yaw rate control (<a href="./../advanced_config/parameter_reference.html#MC_YAWRATE_P">MC_YAWRATE_P</a>, <a href="./../advanced_config/parameter_reference.html#MC_YAWRATE_I">MC_YAWRATE_I</a>, <a href="./../advanced_config/parameter_reference.html#MC_YAWRATE_D">MC_YAWRATE_D</a>, <a href="./../advanced_config/parameter_reference.html#MC_YAWRATE_K">MC_YAWRATE_K</a>)</li></ul><p>The rate controller can be tuned in <a href="./../flight_modes_mc/acro.html">Acro mode</a> or <a href="./../flight_modes_mc/manual_stabilized.html">Stabilized mode</a>:</p><ul><li><p><em>Acro mode</em> is preferred because it allows for isolated rate control testing. However it is significantly harder to pilot.</p><div class="warning custom-block"><p class="custom-block-title">WARNING</p><p>If you choose this mode, you must <a href="./../flight_modes_mc/acro.html#stick-input-mapping">disable all stick expo and have reasonable maximum rates for all axes</a>:</p><ul><li><code>MC_ACRO_EXPO</code> = 0, <code>MC_ACRO_EXPO_Y</code> = 0, <code>MC_ACRO_SUPEXPO</code> = 0, <code>MC_ACRO_SUPEXPOY</code> = 0</li><li><code>MC_ACRO_P_MAX</code> = 200, <code>MC_ACRO_R_MAX</code> = 200</li><li><code>MC_ACRO_Y_MAX</code> = 100</li></ul><p>For PX4 v1.15 and later the defaults are set for this purpose to a maximum rate of 100°/s linear mapping for all axes.</p></div></li></ul><p>:::</p><ul><li><em>Stabilized mode</em> is simpler to fly, but it is also much more difficult to distinguish if attitude or rate controller causes a certain behavior.</li></ul><p>Якщо транспортний засіб зовсім не літає:</p><ul><li>If there are strong oscillations when first trying to takeoff (to the point where it does not fly), decrease all <strong>P</strong> and <strong>D</strong> gains until it takes off.</li><li>If the reaction to RC movement is minimal, increase the <strong>P</strong> gains.</li></ul><p>The actual tuning is roughly the same in <em>Manual mode</em> or <em>Acro mode</em>: You iteratively tune the <strong>P</strong> and <strong>D</strong> gains for roll and pitch, and then the <strong>I</strong> gain. Спочатку ви можете використовувати ті ж значення для крена та тангажу, і як тільки ви отримаєте хороші значення, ви можете їх налаштувати, розглядаючи відповідь на крен та тангаж окремо (якщо ваш транспортний засіб симетричний, це не потрібно). For yaw it is very similar, except that <strong>D</strong> can be left at 0.</p><h5 id="коефіцієнт-пропорціиності-p-k" tabindex="-1">Коефіцієнт пропорційності (P/K) <a class="header-anchor" href="#коефіцієнт-пропорціиності-p-k" aria-label="Permalink to &quot;Коефіцієнт пропорційності (P/K)&quot;">​</a></h5><p>The proportional gain is used to minimize the tracking error (below we use <strong>P</strong> to refer to both <strong>P</strong> or <strong>K</strong>). Він відповідає за швидку відповідь і, отже, повинен бути встановлений як найвище можливо, але без введення коливань.</p><ul><li>If the <strong>P</strong> gain is too high: you will see high-frequency oscillations.</li><li>If the <strong>P</strong> gain is too low: <ul><li>транспортний засіб буде повільно реагувати на зміни введення.</li><li>In <em>Acro mode</em> the vehicle will drift, and you will constantly need to correct to keep it level.</li></ul></li></ul><h5 id="похідне-надходження-d" tabindex="-1">Похідне Надходження (D) <a class="header-anchor" href="#похідне-надходження-d" aria-label="Permalink to &quot;Похідне Надходження (D)&quot;">​</a></h5><p>The <strong>D</strong> (derivative) gain is used for rate damping. Це обов&#39;язково, але повинно бути встановлене лише настільки високо, наскільки потрібно, щоб уникнути перестрілок.</p><ul><li>If the <strong>D</strong> gain is too high: the motors become twitchy (and maybe hot), because the <strong>D</strong> term amplifies noise.</li><li>If the <strong>D</strong> gain is too low: you see overshoots after a step-input.</li></ul><p>Типові значення:</p><ul><li>standard form (<strong>P</strong> = 1): between 0.01 (4&quot; racer) and 0.04 (500 size), for any value of <strong>K</strong></li><li>parallel form (<strong>K</strong> = 1): between 0.0004 and 0.005, depending on the value of <strong>P</strong></li></ul><h5 id="інтегральнии-коефіцієнт-i" tabindex="-1">Інтегральний коефіцієнт (I) <a class="header-anchor" href="#інтегральнии-коефіцієнт-i" aria-label="Permalink to &quot;Інтегральний коефіцієнт (I)&quot;">​</a></h5><p>The <strong>I</strong> (integral) gain keeps a memory of the error. The <strong>I</strong> term increases when the desired rate is not reached over some time. It is important (especially when flying <em>Acro mode</em>), but it should not be set too high.</p><ul><li>Якщо значення I занадто високе: ви побачите повільні коливання.</li><li>If the I gain is too low: this is best tested in <em>Acro mode</em>, by tilting the vehicle to one side about 45 degrees, and keeping it like that. Він повинен зберігати той самий кут. If it drifts back, increase the <strong>I</strong> gain. A low <strong>I</strong> gain is also visible in a log, when there is an offset between the desired and the actual rate over a longer time.</li></ul><p>Типові значення:</p><ul><li>standard form (<strong>P</strong> = 1): between 0.5 (VTOL plane), 1 (500 size) and 8 (4&quot; racer), for any value of <strong>K</strong></li><li>parallel form (<strong>K</strong> = 1): between 0.3 and 0.5 if <strong>P</strong> is around 0.15 The pitch gain usually needs to be a bit higher than the roll gain.</li></ul><h4 id="процедура-тестування" tabindex="-1">Процедура тестування <a class="header-anchor" href="#процедура-тестування" aria-label="Permalink to &quot;Процедура тестування&quot;">​</a></h4><p>To test the current gains, provide a fast <strong>step-input</strong> when hovering and observe how the vehicle reacts. Він має негайно слідувати за командою і не коливатися, ані не перевищувати (відчувається &quot;заблокованим&quot;).</p><p>Ви можете створити ступеневий вхід, наприклад, для крену, швидко натиснувши палицю крену в один бік, а потім швидко відпустити її (будьте обережні, що палиця також буде коливатися, якщо ви просто відпустите її, оскільки вона має пружину - добре налаштований транспортний засіб буде слідувати цим коливанням).</p><div class="info custom-block"><p class="custom-block-title">INFO</p><p>A well-tuned vehicle in <em>Acro mode</em> will not tilt randomly towards one side, but keeps the attitude for tens of seconds even without any corrections.</p></div><h4 id="журнали" tabindex="-1">Журнали <a class="header-anchor" href="#журнали" aria-label="Permalink to &quot;Журнали&quot;">​</a></h4><p>Перегляд журналу допомагає оцінити продуктивність відстеження також. Ось приклад хорошого відстеження кутової швидкості нахилу і кутової швидкості курсу:</p><p><img src="'+o+'" alt="roll rate tracking"><img src="'+i+'" alt="yaw rate tracking"></p><p>І ось хороший приклад відстеження кутової швидкості нахилу з декількома обертами, які створюють екстремальний ступеневий вхід. You can see that the vehicle overshoots only by a very small amount: <img src="'+n+'" alt="roll rate tracking flips"></p><h3 id="контролер-нахилу" tabindex="-1">Контролер нахилу <a class="header-anchor" href="#контролер-нахилу" aria-label="Permalink to &quot;Контролер нахилу&quot;">​</a></h3><p>Це контролює орієнтацію та виводить бажані обороти тіла за допомогою наступних параметрів налаштування:</p><ul><li>Roll control (<a href="./../advanced_config/parameter_reference.html#MC_ROLL_P">MC_ROLL_P</a>)</li><li>Pitch control (<a href="./../advanced_config/parameter_reference.html#MC_PITCH_P">MC_PITCH_P</a>)</li><li>Yaw control (<a href="./../advanced_config/parameter_reference.html#MC_YAW_P">MC_YAW_P</a>)</li></ul><p>Контролер нахилу набагато простіше налаштовувати. Фактично, більшість часу за замовчуванням не потрібно нічого змінювати.</p><p>To tune the attitude controller, fly in <em>Stabilized mode</em> and increase the <strong>P</strong> gains gradually. Якщо почнуть виникати коливання або перехід, коефіцієнти занадто великі.</p><p>Також можна налаштувати наступні параметри. Вони визначають максимальні швидкості обертання навколо всіх трьох осей:</p><ul><li>Maximum roll rate (<a href="./../advanced_config/parameter_reference.html#MC_ROLLRATE_MAX">MC_ROLLRATE_MAX</a>)</li><li>Maximum pitch rate (<a href="./../advanced_config/parameter_reference.html#MC_PITCHRATE_MAX">MC_PITCHRATE_MAX</a>)</li><li>Maximum yaw rate (<a href="./../advanced_config/parameter_reference.html#MC_YAWRATE_MAX">MC_YAWRATE_MAX</a>)</li></ul><h3 id="крива-тяги" tabindex="-1">Крива тяги <a class="header-anchor" href="#крива-тяги" aria-label="Permalink to &quot;Крива тяги&quot;">​</a></h3><p>Налаштування вище оптимізує продуктивність навколо ховер газу. Але можливо ви побачите коливання при руханні в напрямку повного газу.</p><p>To counteract that, adjust the <strong>thrust curve</strong> with the <a href="./../advanced_config/parameter_reference.html#THR_MDL_FAC">THR_MDL_FAC</a> parameter.</p><div class="info custom-block"><p class="custom-block-title">INFO</p><p>The rate controller might need to be re-tuned if you change this parameter.</p></div><p>The mapping from motor control signals (e.g. PWM) to expected thrust is linear by default — setting <code>THR_MDL_FAC</code> to 1 makes it quadratic. Значення між ними використовують лінійну інтерполяцію між двома. Типові значення знаходяться між 0.3 і 0.5.</p><p>If you have a <a href="https://www.tytorobotics.com/pages/series-1580-1585" target="_blank" rel="noreferrer">thrust stand</a> (or can otherwise <em>measure</em> thrust and motor commands simultaneously), you can determine the relationship between the motor control signal and the motor&#39;s actual thrust, and fit a function to the data. The motor command in PX4 called <code>actuator_output</code> can be PWM, Dshot, UAVCAN commands for the respective ESCs in use. <a href="https://github.com/PX4/PX4-user_guide/blob/main/assets/config/mc/ThrustCurve.ipynb" target="_blank" rel="noreferrer">This Notebook</a> shows one way for how the thrust model factor <code>THR_MDL_FAC</code> may be calculated from previously measured thrust and PWM data. The curves shown in this plot are parametrized by both α and k, and also show thrust and PWM in real units (kgf and μs). In order to simplify the curve fit problem, you can normalize the data between 0 and 1 to find <code>k</code> without having to estimate α (α = 1, when the data is normalized).</p><p><img src="'+l+'" alt="Thrust Curve Compensation">] </p><div class="info custom-block"><p class="custom-block-title">INFO</p><p>The mapping between PWM and static thrust depends highly on the battery voltage.</p></div><p>An alternative way of performing this experiment is to make a scatter plot of the normalized motor command and thrust values, and iteratively tune the thrust curve by experimenting with the <code>THR_MDL_FAC</code> parameter. Приклад такої графіки показаний тут:</p><p><img src="'+s+'" alt="Graph showing relative thrust and PWM scatter"></p><p>Якщо дані про сигнал управління двигуном і тягу зібрані на протязі всього масштабного діапазону у експерименті, ви можете нормалізувати дані, використовуючи рівняння:</p><p><em>normalized_value = ( raw_value - min (raw_value) ) / ( max ( raw_value ) - min ( raw_value ) )</em></p><p>Після того, як у вас є діаграма розкиду нормалізованих значень, ви можете спробувати зробити так, щоб крива відповідала шляхом побудови рівняння</p><p>_rel_thrust = ( <code>THR_MDL_FAC</code> ) _ rel_signal^2 + ( 1 - <code>THR_MDL_FAC</code> ) * rel_signal*</p><p>на лінійному діапазоні нормалізованих значень команд двигуна від 0 до 1. Note that this is the equation that is used in the firmware to map thrust and motor command, as shown in the <a href="./../advanced_config/parameter_reference.html#THR_MDL_FAC">THR_MDL_FAC</a> parameter reference. Here, <em>rel_thrust</em> is the normalized thrust value between 0 and 1, and <em>rel_signal</em> is the normalized motor command signal value between 0 and 1.</p><p>In this example above, the curve seemed to fit best when <code>THR_MDL_FAC</code> was set to 0.7.</p><p>Якщо у вас немає доступу до стенду тяги, ви також можете налаштувати коефіцієнт моделювання емпірично. Почніть з 0,3 і збільшуйте його на 0,1 кожного разу. Якщо він занадто великий, ви помітите початок коливань при нижніх значеннях обертів. Якщо він занадто низький, ви помітите коливання при вищих значеннях обертів.</p><p><a id="airmode"></a></p><h3 id="airmode-mixer-saturation" tabindex="-1">Airmode &amp; Mixer Saturation <a class="header-anchor" href="#airmode-mixer-saturation" aria-label="Permalink to &quot;Airmode &amp; Mixer Saturation&quot;">​</a></h3><p>Регулятор швидкості видає команди на обертовий момент для всіх трьох осей (кочан, тангаж і крен) і скалярне значення тяги, які потрібно перетворити в окремі команди тяги для кожного мотора. Цей крок називається міксуванням.</p><p>Можливо, одна з команд мотора стане від&#39;ємною, наприклад, при низькій тязі і великій команді на кочан (і подібно може бути вище 100%). Це насичення міксера. Фізично неможливо виконати ці команди для транспортного засобу (за винятком реверсивних моторів). PX4 має два режими для вирішення цього:</p><ul><li><p>Або шляхом зменшення командованого моменту для кочану таким чином, щоб жодна з команд мотора не була нижче нуля (вимкнено режим &quot;Повітряний режим&quot;). У крайньому випадку, коли командована тяга дорівнює нулю, це означає, що корекція атитюди вже неможлива, тому завжди потрібно мінімальне значення тяги для цього режиму.</p></li><li><p>Або шляхом збільшення (підсилення) командованої тяги таким чином, щоб жодна з команд мотора не була від&#39;ємною (ввімкнено режим &quot;Повітряний режим&quot;). Це має велику перевагу, оскільки атитюди/швидкості можуть слідувати правильно навіть при низькій або нульовій потужності. Загалом це покращує польотні характеристики.</p><p>Однак це збільшує загальну тягу, що може призвести до ситуацій, коли транспортний засіб продовжує підніматися, навіть якщо газ знижується до нуля. Для добре налаштованого, правильно функціонуючого транспортного засобу це не відбувається, але, наприклад, це може статися, коли транспортний засіб сильно коливається через занадто високі значення налаштування P.</p></li></ul><p>Обидва режими показані нижче за допомогою двовимірної ілюстрації для двох моторів і команди на обертовий момент для кочану <span style="color:#9673A6;">r</span>. На лівому моторі <span style="color:#9673A6;">r</span> додається до командованої тяги, тоді як на правому моторі він віднімається від неї. Команди тяги мають <span style="color:#6A9153;">зелений</span> колір. З увімкненим режимом &quot;Повітряний режим&quot; командована тяга збільшується на <span style="color:#B85450;">b</span>. Коли він вимкнений, <span style="color:#9673A6;">r</span> зменшується.</p><p><img src="'+c+'" alt="Airmode"></p><p>Якщо міксування насичується до верхньої межі, командована тяга зменшується, щоб забезпечити, що жоден з моторів не буде командуватися з більшою тягою 100%. Ця поведінка схожа на логіку режиму &quot;Повітряний режим&quot;, і застосовується незалежно від того, чи ввімкнений режим &quot;Повітряний режим&quot;, чи вимкнений.</p><p>Once your vehicle flies well you can enable Airmode via the <a href="./../advanced_config/parameter_reference.html#MC_AIRMODE">MC_AIRMODE</a> parameter.</p>',90)]))}const C=h(u,[["render",f]]);export{M as __pageData,C as default};
